import React,{Component} from 'react';
import axios from 'axios';
import {Redirect} from 'react-router-dom';
import {Badge,Icon} from 'antd';

import './Center.scss'

class Center extends Component{
    constructor(){
        super();
        this.state = {
            tokenType:true,
            aways:[
                {'name':'消息','id':0,'url':'data:image/png;base64,'},
                {'name':'优惠券','id':1,'url':'data:image/png;base64,'},
                {'name':'我的拼团','id':2,'url':'data:image/png;base64,'},
                {'name':'收货地址','id':3,'url':'data:image/png;base64,'},
                {'name':'联系客服','id':4,'url':'data:image/png;base64,'},
                {'name':'会员卡','id':5,'url':'data:image/png;base64,'},
                {'name':'建议反馈','id':6,'url':'data:image/png;base64,'},
                {'name':'退出登录','id':7,'url':'data:image/png;base64,'},
                {'name':'关于我们','id':8,'url':'data:image/png;base64,'},
                {'name':'隐私政策','id':9,'url':'data:image/png;base64,'}
            ]
        }
    }
    //对于是否已经登录的判断我们放在componentWillMount
    componentWillMount(){
        // token 验证
        axios({
            method:'get',
            url:'http://192.168.2.251:7001/center',
            headers:{
                'Authorization':localStorage['token']
            }
        }).then((resp)=>{
            if(resp.data.code === 0){//登录状态和过去成功
                this.setState({
                    tokenType:true,
                })
            }else{
               this.setState({
                   tokenType:false,
               })
            }
            console.log(resp.data);
        })
    }
    componentWillUnmount(){
		this.setState = (state,callback)=>{
			return;
		}
    }
    logout=()=>{
		// localStorage.removeItem('token');
		this.props.history.push('/');
    }
    pushHome =() =>{
        this.props.history.push('/');
    }
    Click(id){
        if(id==7){
            localStorage.removeItem('token');
		    this.props.history.push('/');
        }
    }
    render(){
        if(this.state.tokenType){
            return(
                <div className='Center'>
                    <div className='CenterTitle'>
                        <div><Icon type="left"  onClick={this.logout} /></div>
                        <div>
                            <Icon type="shopping-cart" />
                             <Badge count={0} showZero>
                                <a href="#" className="head-example" />
                            </Badge>
                        </div>
                    </div>
                   <div>
                        <div className='CenterUserImage'>
                            <div className='UserImage'></div>
                            <div className='UserName'>莴笋丝</div>
                            <div className='PushHome' onClick={this.pushHome}>
                                <Icon type="home" theme="filled" /><span>回到首页</span><Icon type="right" />
                            </div>
                        </div>
                   </div>
                   <div className='QuanbuDindan'>
                        <div className='QuanbuDindan-title'><span>全部订单</span><Icon type="right" /></div>
                        <div className='QuanbuDindan-list'>
                            <ul>
                                <li><img src='data:image/png;base64,'/>待付款</li>
                                <li><img src='data:image/png;base64,'/>待发货</li>
                                <li><img src='data:image/png;base64,'/>待收货</li>
                                <li><img src='data:image/png;base64,'/>待评价</li>
                                <li><img src='data:image/png;base64,'/>退货</li>
                            </ul>
                        </div>
                   </div>
                    <div className='ChangYong'>
                        <div className='ChangYong-title'>我猜你经常用</div>
                        <div className='ChangYong-list'>
                            <ul>
                                {
                                    this.state.aways.map((item,index)=><li key={item+index} onClick={()=>this.Click(item.id)}>
                                        <img src={item.url}/>
                                        {item.name}
                                    </li>)
                                }
                            </ul>
                        </div>
                    </div>
                    <div className='Footer'>
                        <span>版权所有鄂ICP备11005814号-10</span>
                        <span>粤公网安备 44010402000077号</span>
                        <span>广州屈臣氏个人用品商店有限公司</span>
                        <span>地址：广州市越秀区东风东路丽丰中心</span>
                    </div>
                </div>
            )
        }else{
            return <Redirect to='/Loding' />
        }
    }
}
export default Center;